import "./App.css";
import { useState } from "react";
import Delete from "./Delete";

const App = () => {
  const [items, setItems] = useState([
    { name: "Milk" },
    { name: "Yogurt" },
    { name: "choc" },
  ]);

  const deleteitem = () => {
    setItems(items.filter((filtitem) => filtitem.name !== items.name));
    console.log(filtitem);
  };
  return (
    <div
      className="Cart"
      style={{
        width: 500,
        height: 500,
        color: "blue",
        border: "solid 2px",
      }}
    >
      {items.map((item) => (
        <h2>
          {item.name}
          <Delete delete={deleteitem} />
        </h2>
      ))}
    </div>
  );
};

export default App;
